clc;
clear;
% close all
warning off;

% 初始猜测
x0 = [4.5,4];
qb = 1;
jj = 5;

% 设计变量的下界和上界
lb = [1, 1];
ub = [10, 10];

% 创建 nlopt_opt 结构体
opt.algorithm = NLOPT_LD_AUGLAG;  %NLOPT_LD_AUGLAG   NLOPT_LN_COBYLA   NLOPT_GN_ORIG_DIRECT_L     NLOPT_GN_ISRES,

opt.dimension = 2; % 优化问题的维度，确保是标量
opt.lower_bounds = lb; % 下界，必须是一个向量
opt.upper_bounds = ub; % 上界，必须是一个向量
opt.min_objective = @(x)jfg_f_wrapper(x);
opt.fc = { (@(x) constraint1_wrapper(x)),(@(x) constraint2_wrapper(x)),(@(x) constraint3_wrapper(x)),(@(x) constraint4_wrapper(x)),(@(x) constraint5_wrapper(x)),(@(x) constraint6_wrapper(x)),(@(x) constraint7_wrapper(x)) };
opt.fc_tol = [1e-10, 1e-10, 1e-10, 1e-10, 1e-10, 1e-10, 1e-10];

opt.xtol_rel = 1e-12;
opt.maxeval = 200; % 最大迭代次数，标量

% 用来存储每一步的适应度函数值
global fitness_values constraint_values1 constraint_values2 constraint_values3 constraint_values4 constraint_values5 constraint_values6 constraint_values7;
fitness_values = [];
constraint_values1 = [];
constraint_values2 = [];
constraint_values3 = [];
constraint_values4 = [];
constraint_values5 = [];
constraint_values6 = [];
constraint_values7 = [];
% 调用 nlopt_optimize 函数进行优化
[x, fn, retcode] = nlopt_optimize(opt, x0);

% 显示结果
disp('************** 连杆机构实现函数优化设计最优解 ******************');
fprintf(1, '      连杆相对长度           a = %3.4f \n', x(1));
fprintf(1, '      摇杆相对长度           b = %3.4f \n', x(2));
fprintf(1, '      输出角平方误差之和      f* = %3.4f \n', fn);
g = cdj_g(x);
disp '*********** 最优点的性能约束函数值 **************'
fprintf(1, '       最小传动角约束函数值     g1*=%3.4f\n', g(1))
fprintf(1, '       最大传动角约束函数值     g2*=%3.4f\n', g(2))

% 绘制适应度函数值变化曲线
figure (1);
plot(fitness_values, '-');
xlabel('Iteration');
ylabel('Fitness Function Value');
title('Fitness Function Value vs. Iteration');
grid on;
hold on

